                            Body = "<!DOCTYPE html>\r\n<html>\r\n<head>\r\n  <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\r\n  <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\" />\r\n  <title>Subify Email Doğrulama</title>\r\n  <style>\r\n    /* Genel Resetler */\r\n    body {\r\n      background-color: #f4f4f7;\r\n      font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Helvetica, Arial, sans-serif;\r\n      -webkit-font-smoothing: antialiased;\r\n      font-size: 14px;\r\n      line-height: 1.4;\r\n      margin: 0;\r\n      padding: 0;\r\n      -ms-text-size-adjust: 100%;\r\n      -webkit-text-size-adjust: 100%;\r\n    }\r\n\r\n    table {\r\n      border-collapse: separate;\r\n      mso-table-lspace: 0pt;\r\n      mso-table-rspace: 0pt;\r\n      width: 100%;\r\n    }\r\n\r\n    /* Ana Konteyner */\r\n    .container {\r\n      display: block;\r\n      margin: 0 auto !important;\r\n      max-width: 580px;\r\n      padding: 10px;\r\n      width: 580px;\r\n    }\r\n\r\n    /* İçerik Kutusu */\r\n    .content {\r\n      box-sizing: border-box;\r\n      display: block;\r\n      margin: 0 auto;\r\n      max-width: 580px;\r\n      padding: 10px;\r\n    }\r\n\r\n    /* Beyaz Kart Tasarımı */\r\n    .main {\r\n      background: #ffffff;\r\n      border-radius: 8px;\r\n      width: 100%;\r\n      box-shadow: 0 4px 10px rgba(0, 0, 0, 0.03);\r\n    }\r\n\r\n    .wrapper {\r\n      box-sizing: border-box;\r\n      padding: 40px;\r\n    }\r\n\r\n    /* Tipografi */\r\n    h1 {\r\n      font-size: 24px;\r\n      font-weight: 700;\r\n      margin: 0;\r\n      margin-bottom: 20px;\r\n      color: #1a1a1a;\r\n      text-align: center;\r\n    }\r\n\r\n    p {\r\n      font-size: 16px;\r\n      font-weight: normal;\r\n      margin: 0;\r\n      margin-bottom: 20px;\r\n      color: #555555;\r\n      line-height: 1.6;\r\n      text-align: center;\r\n    }\r\n\r\n    /* Buton Tasarımı - Subify için Mor Tonları */\r\n  